    console.log(fruit)
  return (
    <div>
        <h1>The {fruit.name} is {fruit.color}</h1>
        {
            fruit.readyToEat ? "It's ready to eat" : "Ew Yuck!"
        }
    </div>
  )
}

module.exports = Show;

